  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains values for Nationally
  Consistent Data and Measures (NCDMs) designated by the national Environmental Public
  Health Tracking Program and indicators developed by the State Environmental Health
  Indicators Collaborative, Council of State and Territorial Epidemiologists. These
  indicators and measures are derived from U.S. EPA, EPA Air Explorer (http://epa.gov/mxplorer/index.htm).
